import styled from "styled-components";

const FooterStyled = styled.div`
    background-color:#F0F2F7;
    padding-top:6rem;

`;


const Footer = () => (
    <FooterStyled>
        <div className="container">
            <div class="columns">
                <div class="column">
                    First column
                    </div>
                <div class="column">
                    Second column
                    </div>
                <div class="column">
                    Third column
                    </div>
                <div class="column">
                    Fourth column
                    </div>
            </div>
        </div>
    </FooterStyled>


);



export default Footer;
